import { Component } from "react";

export default class TravelPlans extends Component {
  constructor() {
    super();
    this.state = {
      userDetals: this.props.LoggedUser,
    };
  }
  componentDidMount = () => {};
  render() {
    console.log(this.state.userDetals);
    return (
      <div>
        <h1>TravelPlans</h1>
        <div className="userDetals">
          <h2></h2>
        </div>
        <button>add new Plan</button>
      </div>
    );
  }
}
